--Name--
Equivalent EFA practice

-- Definition --
Equivalent practices with EFAs which are listed  in section III of Annex IX of Regulation (EU) No 1307/2013.

-- Description --
EFA equivalent practices include:
-ecological set-aside;
-buffer zones for high nature value areas ( Natura 2000 or similar);
-uncultivated buffer strips and field margins;
-patches managed for wildlife or specific fauna;
-management of LF;
-keeping arable peaty or wet soils under grass;
-production on arable land without fertilizers or plant protection products (for 2 years with different crops);
-conversion of arable land into permanent grassland extensively used.

NOTE: The specific AECM reason has to be linked to the EFA type.
